
var KalturaPurchaseSettingsService={get:function(by){var kparams=new Object();kparams.by=by;return new KalturaRequestBuilder("purchasesettings","get",kparams);},update:function(entityReference,settings){var kparams=new Object();kparams.entityReference=entityReference;kparams.settings=settings;return new KalturaRequestBuilder("purchasesettings","update",kparams);}}